import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class ApiClientService {

  data: any;

  constructor(private http: HttpClient) {}

  getAllPokemon() {
    return this.http.get('http://localhost:3000/pokemon')
  }
}
